//import React, {useState, useContext} from 'react'
class DailyTimeBudget extends Component {
  constructor(props) {
    super(props);

    this.hoursInWeek = 168;
    this.hoursInDay = 24;
    this.activityWeekCategories = {
      sleep: 7,
      exercise: 7,
      work: 49,
      free: 7,
      errands: 14,
      getReady: 28,
      totalHours: 168
    };

    this.activityDayCategories = {
      sleep: 7,
      exercise: 1,
      work: 9,
      free: 1,
      errands: 2,
      getReady: 4,
      totalHours: 24
    };

    this.daysOfWeek = {
      Monday: {},
      Tuesday: {},
      WednesDay: {},
      ThursDay: {},
      Friday: {},
      Saturday: {},
      Sunday: {}
    };
    this.dailyBudget = {};

    //create a seperate object that contains activityCategories
    this.timeBudgetDay = () => {
      Object.keys(this.daysOfWeek).map(day => {
        //give each day the categories w/ hours
        console.log(day);
        return { ...this.dailyBudget, [day]: this.activityDayCategories };
      });
    };

    // timeBudgetWeek = () => {
    //   //
    // }
  }
  render() {
    console.dir({ ...this.dailyBudget.Monday });
    return (
      <div className={classes.DailyTimeBudget}>
        <div className={classes.Activity}>{this.props.activity}</div>
        <div className={classes.Activity}>{this.props.hours}</div>
        <button className={classes.Less}>Less</button>
        <button className={classes.More}>More</button>
      </div>
    );
  }
}

export default DailyTimeBudget;

